I am looking for a few parts to complete a rebuild on an Enfield No. 1 MK III:

1. Complete bolt or the components to construct one;
2. 10-Rd magazine;
3. Complete stock set with hardware;
I know I can order these and have done so with some, but I thought I'd check to see if anyone here may have old parts lying around they'd like to recoup some costs by selling them to me.
Also, have 22LR for trade for complete weapons.
Thanks for reading.
Take care.

This ad is for the rifle only, with no accessories other than what is shown below. AKMS  (AK-47) Polish Underfolder in 7.62x39, imported by Century International Arms.

*Hogue overmolded rubber stock set with 4 optional picatinny rails;
*2 TAPCO magazine (31-round capacity);
*Polish Tantal sling;
*TAPCO G2 Trigger;
*TAPCO slotted muzzle brake;
*Green mountain barrel.

Gun runs flawlessly with every type of ammo and shoots accurately. Easy to stow away in truck compartments or other small spaces. $750 OBO, cash only, no trades. Located in NE Dallas near the Arboretum.
